import React from "react";

function Banner() {
  return (
    <section>
      <img
        src="https://images.pexels.com/photos/135620/pexels-photo-135620.jpeg?cs=srgb&dl=pexels-shattha-pilabut-135620.jpg&fm=jpg"
        alt="error"
      />
    </section>
  );
}

export default Banner;
